def playstep2(hand, dice):

	num = set(str(hand))

	if len(num)==1:
		return (hand, dice)

	elif (len(num)!=2):
		hand = str(hand)
		dice = str(dice)
		res = max(hand)+dice[-2:]
		res2 = ''.join(sorted(res))
		return (int(res2[::-1]), int(dice[:-2]))

	else:
		hand = str(hand)
		dice = str(dice)
		res = dice[-1:]
		for i in (hand):
			if hand.count(i)>1:
				res = res + i 
		res2 = ''.join(sorted(res))
		return (int(res2[::-1]), int(dice[:-1]))
